pub enum Chunk<'a> {
    NeedMoreData(u64),
    Parsed {
            consumed: usize,
            payload: Payload,
        },
}

pub enum Payload<'a> {
    Version {
            num: u32,
            range: Range,
        },
    TypeSection(crate::TypeSectionReader),
    ImportSection(crate::ImportSectionReader),
    AliasSection(crate::AliasSectionReader),
    InstanceSection(crate::InstanceSectionReader),
    ModuleSection(crate::ModuleSectionReader),
    FunctionSection(crate::FunctionSectionReader),
    TableSection(crate::TableSectionReader),
    MemorySection(crate::MemorySectionReader),
    GlobalSection(crate::GlobalSectionReader),
    ExportSection(crate::ExportSectionReader),
    StartSection {
            func: u32,
            range: Range,
        },
    ElementSection(crate::ElementSectionReader),
    DataCountSection {
            count: u32,
            range: Range,
        },
    DataSection(crate::DataSectionReader),
    CustomSection {
            name: &'a str,
            data_offset: usize,
            data: &'a [u8],
        },
    CodeSectionStart {
            count: u32,
            range: Range,
            size: u32,
        },
    CodeSectionEntry(crate::FunctionBody),
    ModuleCodeSectionStart {
            count: u32,
            range: Range,
            size: u32,
        },
    ModuleCodeSectionEntry {
            parser: Parser,
            range: Range,
        },
    UnknownSection {
            id: u8,
            contents: &'a [u8],
            range: Range,
        },
    End,
}

pub enum TypeDef<'a> {
    Func(FuncType),
    Instance(InstanceType),
    Module(ModuleType),
}

pub enum MemoryType {
    M32 {
            limits: ResizableLimits,
            shared: bool,
        },
    M64 {
            limits: ResizableLimits64,
        },
}

